import "./Login.css";

const Login = () => {
  function onSubmitHandler(e) {
    e.preventDefault();
    const apiUrl = "http://local";

    // Make a GET request
    fetch(apiUrl)
      .then((response) => {
        if (!response.ok) {
          throw new Error("Network response was not ok");
        }
        return response.json();
      })
      .then((data) => {
        console.log(data);
      })
      .catch((error) => {
        console.error("Error:", error);
      });
  }
  return (
    <div className="auth-container">
      <div className="auth-form-container">
        <h2 className="auth-title">Login</h2>
        <form action="/auth" method="POST" onSubmit={onSubmitHandler}>
          <label className="auth-text">Username</label>
          <input type="text" />
          <label className="auth-text">Password</label>
          <input type="password" />
          <button className="auth-submit-btn">Submit</button>
        </form>
      </div>
    </div>
  );
};

export default Login;
